import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Login.css';

const Login = () => {
  const [email, setEmail] = useState('m32220@gmail.com');
  const [password, setPassword] = useState('');
  const [remember, setRemember] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    try {
      const res = await fetch('http://localhost:5000/api/auth/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email, password })
      });
      const data = await res.json();
      if (!res.ok) throw new Error(data.message || 'Login failed');
      // Store user email and redirect to dashboard after successful login
      localStorage.setItem('userEmail', email);
      navigate('/dashboard');
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div className="login-container" style={{ display: 'flex', minHeight: '100vh', background: '#f8f9fa' }}>
      <div style={{ flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center', position: 'relative', background: 'radial-gradient(ellipse at left top, #1b2e2e 60%, #1b2e2e 100%)' }}>
        <img src="/image.png" alt="Login Illustration" style={{ position: 'absolute', right: 0, top: 0, width: '70%', height: '100%', objectFit: 'cover', opacity: 0.18, zIndex: 1 }} />
        <div style={{ position: 'relative', zIndex: 2, width: '100%', maxWidth: 380, background: '#fff', borderRadius: 18, boxShadow: '0 2px 16px rgba(0,0,0,0.07)', padding: '38px 32px' }}>
          <h2 style={{ fontWeight: 700, fontSize: '2rem', marginBottom: 18, color: '#222' }}>Login</h2>
          <p className="login-welcome" style={{ color: '#888', marginBottom: 18 }}>Welcome back, please enter your details to log in.</p>
          <form onSubmit={handleSubmit} className="login-form" style={{ display: 'flex', flexDirection: 'column', gap: 16 }}>
            <label style={{ fontWeight: 500, marginBottom: 4 }}>Email Address</label>
            <input type="email" value={email} onChange={e => setEmail(e.target.value)} required style={{ padding: '12px 14px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: '1rem' }} />
            <label style={{ fontWeight: 500, marginBottom: 4 }}>Password</label>
            <input type="password" value={password} onChange={e => setPassword(e.target.value)} required style={{ padding: '12px 14px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: '1rem' }} />
            <div className="login-options" style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginTop: 8 }}>
              <label className="remember-me" style={{ fontSize: 14 }}>
                <input type="checkbox" checked={remember} onChange={e => setRemember(e.target.checked)} /> Remember me
              </label>
              <Link to="/reset-password" className="forgot-password" style={{ color: '#4be08a', fontWeight: 500 }}>Forgot password?</Link>
            </div>
            {error && <div className="login-error" style={{ color: '#e74c3c', marginTop: 8 }}>{error}</div>}
            <button type="submit" className="login-btn" style={{ background: '#4be08a', color: '#fff', fontWeight: 700, border: 'none', borderRadius: 8, padding: '12px 0', fontSize: '1.1rem', marginTop: 8 }}>Log In</button>
            <div className="login-or" style={{ textAlign: 'center', color: '#bbb', margin: '16px 0 0 0' }}>Or</div>
            <div className="login-signup" style={{ textAlign: 'center', marginTop: 8 }}>Don't have an account? <Link to="/signup" style={{ color: '#4be08a', fontWeight: 500 }}>Sign Up</Link></div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Login;
